import "./scss/app.scss";

import Auth from "./pages/Auth";

function App() {
    return (
        <div className="wrapper">
            <div className="content">
                <div className="container">
                    <Routes>
                        <Route path="/" element={<Auth />} />
                    </Routes>
                </div>
            </div>
        </div>
    );
}

export default App;
